import win32com.client


def send_email(id, name, email, rd, attch):
    ol = win32com.client.Dispatch('Outlook.Application')
    ### set dimensions of email body
    olmailitem = 0x0
    newmail = ol.CreateItem(olmailitem)
    newmail.Subject= f'DVM TESTING - {id} {name} Monthly Reporting as of '
    newmail.To='revans@americanveterinarygroup.com'
    newmail.HTMLBody= f"""
        Dear {name},<br><br>
        Please see attached for your monthly report.<br>
    """

    newmail.Attachments.Add(attch)

    ### To display the mail before sending it
    # newmail.Display() 

    newmail.Send()


